CREATE TABLE GrupoUsuario(
	IdGrupoUsuario INTEGER IDENTITY PRIMARY KEY,
	Grupo NVARCHAR(20) NOT NULL,
	CONSTRAINT UC_Grupo_Id UNIQUE (IdGrupoUsuario),
	CONSTRAINT UC_Grupo_Nombre UNIQUE (Grupo)
);

CREATE TABLE Usuario(
	Usuario NVARCHAR(100) PRIMARY KEY,
	Contrasenia NVARCHAR(500) NOT NULL,
	IdGrupoUsuario INTEGER NOT NULL,
	Nombre NVARCHAR(30) NOT NULL,
	PrimerApellido NVARCHAR(30) NOT NULL,
	SegundoApellido NVARCHAR(30) NOT NULL,
	IdCiudad INTEGER NOT NULL,
	Telefono CHAR(9) NOT NULL,
	Direccion NVARCHAR(200) NOT NULL,
	Nif CHAR(9) NOT NULL,
	Fax NVARCHAR(100) ,--NO ES OBLIGATORIO
	Email NVARCHAR(100) NOT NULL,
	CONSTRAINT CH_Usuario_Restriccion_Telefono CHECK (Telefono like '[0-9][0-9][0-9][0-9][0-9][0-9][0-9][0-9][0-9]'),--9 numeros
	CONSTRAINT CH_Usuario_Grupo FOREIGN KEY (IdGrupoUsuario) REFERENCES GrupoUsuario(IdGrupoUsuario),
    	CONSTRAINT Fk_Id_Usuario_Ciudad FOREIGN KEY (IdCiudad) REFERENCES Ciudades(IdCiudad) ON DELETE CASCADE ON UPDATE CASCADE,
	CONSTRAINT UC_Usuario_NIF UNIQUE (Nif),
	CONSTRAINT UC_Usuario_NickUsuario UNIQUE (Usuario),
	CONSTRAINT CH_Usuario_Restriccion_Grupo CHECK (IdGrupoUsuario like 1 OR IdGrupoUsuario LIKE 2 OR IdGrupoUsuario LIKE 3 )
);

/*nuevas*/
CREATE TABLE Tiendas(
	IdTienda INTEGER IDENTITY PRIMARY KEY,
	Nombre VARCHAR(50) NOT NULL,
	IdCiudad INTEGER NOT NULL,
	Telefono CHAR(9) NOT NULL,
	Direccion VARCHAR(200) NOT NULL,
	ImagenTienda VARCHAR(200) NOT NULL,
	srcIframe NVARCHAR(4000),
	CONSTRAINT CH_Telefono_Restriccion_Tiendas CHECK (Telefono like '[0-9][0-9][0-9][0-9][0-9][0-9][0-9][0-9][0-9]'),--9 numeros -- '%[^0-9]%'
	CONSTRAINT Fk_Id_Ciudad FOREIGN KEY (IdCiudad) REFERENCES Ciudades(IdCiudad) ON DELETE CASCADE ON UPDATE CASCADE
);



CREATE TABLE Almacen(
	IdEjemplar INTEGER NOT NULL,
	IdTienda INTEGER NOT NULL,
	Stock INTEGER NOT NULL,
	--CONSTRAINT PkAlmacen PRIMARY KEY (idArticulo, idTienda),
	CONSTRAINT FK_Id_EjemplaresAlmacen FOREIGN KEY (IdEjemplar) REFERENCES Ejemplares(IdEjemplar) ON DELETE CASCADE ON UPDATE CASCADE,
	CONSTRAINT FK_ID_Tienda_Almacen FOREIGN KEY (IdTienda) REFERENCES Tiendas(IdTienda) --ON DELETE CASCADE ON UPDATE CASCADE
);
