--vistas--

go
CREATE VIEW librosPaginaPrincipal AS 
SELECT  Libros.IdLibro,Libros.Titulo,Ejemplares.YearPublicacion  ,Autores.Nombre as nombre_autor ,Ejemplares.Idioma,Ejemplares.Paginas,
Ejemplares.PVP,
Libros.Descripcion,Ejemplares.Portada,Categorias.NombreCategoria FROM Libros 
JOIN Autores ON Autores.IdAutor = Libros.IdAutor
JOIN Ejemplares ON Ejemplares.IdLibro = Libros.IdLibro
JOIN SubCategorias ON SubCategorias.IdSubCategoria = Libros.IdSubCategoria
JOIN Categorias ON Categorias.IdCategoria = SubCategorias.IdCategoria

--vistas--
