CREATE VIEW libroIndividual AS 
SELECT Ejemplares.IdEjemplar, Libros.IdLibro,Categorias.NombreCategoria AS Nombre_Categoria,SubCategorias.IdSubCategoria,
	Subcategorias.NombreSubCategoria as Nombre_SubCategoria
	,Libros.Titulo,Ejemplares.YearPublicacion,Ejemplares.FechaDisponibilidad  ,Autores.Nombre as nombre_autor ,
	Ejemplares.Encuadernacion AS Encuadernacion, Ejemplares.NumeroEdicion AS Numero_Edicion,
	 Ejemplares.Formato,Ejemplares.Idioma,Ejemplares.ISBN,Ejemplares.Paginas,Ejemplares.PVP,Libros.Descripcion,Ejemplares.Portada 
FROM Libros 
JOIN Autores ON Autores.IdAutor = Libros.IdAutor
JOIN Subcategorias ON subcategorias.IdSubCategoria = Libros.IdSubCategoria
JOIN Categorias ON Categorias.IdCategoria = Subcategorias.IdCategoria
JOIN Ejemplares ON Ejemplares.IdLibro = Libros.IdLibro;
