CREATE VIEW librosPorMateria AS 
SELECT COUNT(Libros.IdLibro) AS NUMERO_LIBROS, Categorias.IdCategoria, Categorias.NombreCategoria, Categorias.Descripcion 
FROM Categorias
INNER JOIN SubCategorias ON SubCategorias.IdCategoria = Categorias.IdCategoria
INNER JOIN Libros ON Libros.IdSubCategoria = SubCategorias.IdSubCategoria
GROUP BY Categorias.IdCategoria, Categorias.NombreCategoria, Categorias.Descripcion
--vistas--
