CREATE VIEW librosPorSubcategorias AS 
SELECT COUNT(Libros.IdLibro) AS NUMERO_LIBROS, SubCategorias.IdSubCategoria, SubCategorias.NombreSubCategoria, SubCategorias.Descripcion 
,Categorias.IdCategoria
FROM SubCategorias
INNER JOIN Libros ON Libros.IdSubCategoria = SubCategorias.IdSubCategoria
INNER JOIN Categorias ON Categorias.IdCategoria = SubCategorias.IdCategoria
GROUP BY SubCategorias.IdSubCategoria, SubCategorias.NombreSubCategoria, SubCategorias.Descripcion ,Categorias.IdCategoria;
--vistas--
