CREATE VIEW librosSubcategoriasVer AS 
SELECT Libros.IdLibro, SubCategorias.IdSubCategoria,Categorias.NombreCategoria,SubCategorias.NombreSubCategoria, 
Libros.Titulo,Ejemplares.YearPublicacion
,Ejemplares.FechaDisponibilidad,Ejemplares.Idioma,Ejemplares.ISBN, Ejemplares.Paginas,Ejemplares.PVP,Libros.Descripcion,Ejemplares.Portada
FROM SubCategorias
INNER JOIN Libros ON Libros.IdSubCategoria = SubCategorias.IdSubCategoria
INNER JOIN Categorias ON Categorias.IdCategoria = SubCategorias.IdCategoria
JOIN Ejemplares ON Ejemplares.IdLibro = Libros.IdLibro;

