CREATE VIEW LibrosLateral1 AS
SELECT Categorias.IdCategoria, Categorias.NombreCategoria, COUNT(Libros.Titulo) AS numero
FROM Categorias
JOIN SubCategorias ON SubCategorias.IdCategoria = Categorias.IdCategoria
JOIN Libros ON Libros.IdSubCategoria = SubCategorias.IdSubCategoria
GROUP BY Categorias.IdCategoria, Categorias.NombreCategoria;
