CREATE VIEW LibrosLateral2 AS
SELECT SubCategorias.IdSubCategoria ,SubCategorias.NombreSubCategoria,Categorias.IdCategoria,COUNT(Libros.Titulo) AS numero
FROM Categorias
JOIN SubCategorias ON SubCategorias.IdCategoria = Categorias.IdCategoria
JOIN Libros ON Libros.IdSubCategoria = SubCategorias.IdSubCategoria
GROUP BY SubCategorias.IdSubCategoria ,SubCategorias.NombreSubCategoria,Categorias.IdCategoria ;
